import React from "react";
import avater from "../media/phototo.webp";
import { IoNotifications } from "react-icons/io5";

function NavBar() {
	return (
		<div className="fixed w-full left-0 right-0 top-0 bg-teal-800 shadow-md px-4 py-2">
			<div className="flex items-center justify-center gap-4  rounded-full">
				<div className="w-9 rounded-full h-9 ">
					<img
						src={avater}
						className="rounded-full "
						fill
						alt="log"
					/>
				</div>
				<h1>Addmen DashBord</h1>
			</div>
			<div className="fle"></div>
		</div>
	);
}

export default NavBar;
